choices.text:
if (dicRevision == 5)
{
    // PDFBOX-821
    dicPermissions &= ~(0xfffff0c0);
}
else if (dicRevision == 6)
{
    // PDFBOX-1954
    dicPermissions &= ~(0xfffffffc);
}
else
{
    dicPermissions &= ~(0xffffff00);
}
setCurrentAccessPermission(new AccessPermission(dicPermissions));

